import React from 'react'
import '../../../../Styles/Home/Grid/Main/Main.css'
import './Views/AboutClub'

const Main = () => {
    return (
        <main>
            <div className="about-club">
                About Club
            </div>
            <div className="slideshow">
                Slideshow
            </div>
            <div className="tools">
                Tools
            </div>
        </main>
    );
}


export default Main;
